import React from 'react';

const styles = {
  footer: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'center',
    height: '100%',
    background: '#dad7cd',
  },
  space: {
    padding: '0 10px 0 0'
  }
};

export default function Footer() {
  return (
    <div style={styles.footer}>
      <i class="fa-brands fa-github fa-lg"></i>
      <i class="fab fa-linkedin-in fa-lg"></i>
    </div>
  );
}
